\textbf{\texttt{SupervisedTask} summary}

Learning task for the supervised task with input \texttt{Image\{2\}} and target \texttt{Mask\{2, String\}}. Compatible with \texttt{model}s that take in \texttt{Bounded\{2, FastVision.ImageTensor\{2\}\}} and output \texttt{Bounded\{2, FastAI.OneHotTensor\{2, String\}\}}.

Encoding a sample (\texttt{encodesample(task, context, sample)}) is done through the following encodings:

\begin{tabular}
{r | r | r | r}
Encoding & Name & \texttt{blocks.input} & \texttt{blocks.target} \\
\hline
 & \texttt{(input, target)} & \texttt{Image\{2\}} & \texttt{Mask\{2, String\}} \\
\texttt{ProjectiveTransforms} &  & \textbf{\texttt{Bounded\{2, Image\{2\}\}}} & \textbf{\texttt{Bounded\{2, Mask\{2, String\}\}}} \\
\texttt{ImagePreprocessing} &  & \textbf{\texttt{Bounded\{2, FastVision.ImageTensor\{2\}\}}} &  \\
\texttt{OneHot} & \texttt{(x, y)} &  & \textbf{\texttt{Bounded\{2, FastAI.OneHotTensor\{2, String\}\}}} \\
\end{tabular}
